package datos.trabajo;


public class Equipo {
	private int idEquipo;
	private java.lang.String placa;
	private java.lang.String marca;
	private java.lang.String tipoAire;
	private int btu;
	private java.lang.String ubicacion;
	private double amperaje;
	private double voltaje;
	private int precionAlta;
	private int presionBaja;
	private java.lang.String refrigerante;

	public Equipo() {
		// TODO Auto-generated constructor stub
	}

	public java.lang.String getPlaca() {
		return placa;
	}

	public void setPlaca(java.lang.String string) {
		this.placa = string;
	}

	public java.lang.String getTipoAire() {
		return tipoAire;
	}

	public void setTipoAire(java.lang.String string) {
		this.tipoAire = string;
	}

	public int getBtu() {
		return btu;
	}

	public void setBtu(int btu) {
		this.btu = btu;
	}

	public java.lang.String getUbicacion() {
		return ubicacion;
	}

	public void setUbicacion(java.lang.String string) {
		this.ubicacion = string;
	}

	public double getAmperaje() {
		return amperaje;
	}

	public void setAmperaje(double amperaje) {
		this.amperaje = amperaje;
	}

	public double getVoltaje() {
		return voltaje;
	}

	public void setVoltaje(double voltaje) {
		this.voltaje = voltaje;
	}

	public int getPrecionAlta() {
		return precionAlta;
	}

	public void setPrecionAlta(int precionAlta) {
		this.precionAlta = precionAlta;
	}

	public int getPresionBaja() {
		return presionBaja;
	}

	public void setPresionBaja(int presionBaja) {
		this.presionBaja = presionBaja;
	}

	public java.lang.String getRefrigerante() {
		return refrigerante;
	}

	public void setRefrigerante(java.lang.String string) {
		this.refrigerante = string;
	}

	public int getIdEquipo() {
		return idEquipo;
	}

	public void setIdEquipo(int idEquipo) {
		this.idEquipo = idEquipo;
	}

	public java.lang.String getMarca() {
		return marca;
	}

	public void setMarca(java.lang.String marca) {
		this.marca = marca;
	}
	
	
	

}
